import React, { useEffect, useState } from 'react';
import { apiInventary } from '../../apiCalls/apiCalls';
import { useApiConstructor } from "../../apiCalls/apiConstructor";
import { Inventary } from "../../cons/urls"

const ArticlesList = () => {
  const [articles, setArticles] = useState([]);
  const [error, setError] = useState(null);
  const apiCall = useApiConstructor(Inventary);

  useEffect(() => {
    const fetchArticles = async () => {
      try {
        const response = await apiCall.get('/products');
        setArticles(response.data);
      } catch (err) {
        setError('Error fetching articles');
        console.error(err);
      }
    };

    fetchArticles();
  }, []);

  if (error) {
    return <div>{error}</div>;
  }

  return (
    <div>
      <h1>Articles List</h1>
      <ul>
        {articles.map((article) => (
          <li key={article.id}>{article.name} {article.price} {article.discount}</li>
        ))}
      </ul>
    </div>
  );
};

export default ArticlesList;
